import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import ShoppingList from './ShoppingList'
import AllShoppingLists from './AllShoppingLists';

export class ShoppingListViewer extends React.Component {
    render() {
        return(
            <section className='rowC'>
                <div id="viewer">
                    <h1>Shopping Lists</h1>
                    <ListOfLists />
                    <ListOfProducts />
                </div>

                <div className="columns">
   
      </div>
            </section>
        );
    }

}

const ListOfLists = props => (
    <h2>All Shopping Lists</h2>
);

const ListOfProducts = props => (
    <h3>eggs</h3>
);



export default ShoppingListViewer;
